import java.util.Arrays;
import java.util.Scanner;

class  Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        int m = sc.nextInt();
        int k = sc.nextInt();
        long[] menHeights = new long[n];
        long[] womenHeights = new long[m];
        for (int i = 0; i < menHeights.length; i++) {
            menHeights[i] = sc.nextLong();
        }

        for (int i = 0; i < womenHeights.length; i++) {
            womenHeights[i] = sc.nextLong();
        }

        Arrays.sort(menHeights);
        Arrays.sort(womenHeights);

        // long maxHeight = Math.abs(Math.max(menHeights[n - 1], womenHeights[m - 1]) - Math.min(menHeights[0], womenHeights[0]));
        long maxHeight = Long.MAX_VALUE;
        long l = 0;
        long r = maxHeight;
        long countMax = Long.MAX_VALUE;
        boolean flag = false;
        while (r - l >= 0) {
            long middle = l + (r - l) / 2;
            int countTempt = count(menHeights, womenHeights, middle);
            if (countTempt < k) {
                l = middle + 1;
            } else if (countTempt > k) {
                r = middle - 1;
            } else {
                countMax = Math.min(countMax, middle);
                r = middle - 1;
                flag = true;
            }
        }

        System.out.println((flag) ? countMax : 0);
    }

    public static int count(long[] menHeights, long[] womenHeights, long threshold) {
        int i = 0;
        int j = 0;
        int count = 0;
        while (i < menHeights.length && j < womenHeights.length) {
            long tempt = Math.abs(menHeights[i] - womenHeights[j]);
            if (tempt <= threshold) {
                count++;
                i++;
                j++;
            } else {
                if (womenHeights[j] >= menHeights[i])
                    i++;
                else
                    j++;
            }
        }

        return count;
    }
}
